import React, { useState } from "react";
import {Button, Drawer} from 'antd';

const settings = {
  position: 'absolute',
  top: '50%',
  right: '5px',
};

const AntSetting = () => {
  const [visible, setVisible] = useState(true);

  function onClose() {
    setVisible(false);
  }

  return (
    <div>
      <Button type="primary" shape="round" icon="setting" style={settings}/>
      <Drawer
        title="Basic Drawer"
        placement="right"
        closable={false}
        onClose={this.onClose}
        visible={visible}
      >
        <p>Some contents...</p>
        <p>Some contents...</p>
        <p>Some contents...</p>
      </Drawer>
    </div>
  );
};

export default AntSetting;
